import React, { useEffect, useState } from "react";

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then((data) => setMessage(data.message))
      .then;
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        {message ? <h1>{message}</h1> : "Loading..."}
      </header>
    </div>
  );
}

export default App;
